import React, { Component } from 'react';
import {
  FormGroup,
  Label,
  Input,
  Col,
  Row,
  Table,
  // Form,
  // Button,
} from 'reactstrap';
import InputMask from 'react-input-mask';

class Form1 extends Component {

  constructor(props) {
    super(props);
    this.state = {
      form1data:[],
      h1: '',
      h2: '',
      h3: '',
      h4: '',
      h5: '',
      h6: '',
      h7: '',
      h8: '',
      h9: '',
      h10: '',
      h11: '',
      enigrs: '',
      eninsk: '',
      region: '',
      district: '',
      town: '',
      cdistrict: '',
      mdistrict: '',
      pgt: '',
      aimak: '',
      ayil: '',
      street: '',
      house: '',
      room: '',
      name: '',
      office: '',
      persons: [],
      form1data: []
    };
    this.handleChangeForm1 = this.handleChangeForm1.bind(this);
    // this.handleSubmitForm1 = this.handleSubmitForm1.bind(this);
    this.cleardataForm1 = this.cleardataForm1.bind(this);
    // this.tabtoggle = this.tabtoggle.bind(this);
  }

  cleardataForm1() {
    this.setState({
      h1: '',
      h2: '',
      h3: '',
      h4: '',
      h5: '',
      h6: '',
      h7: '',
      h8: '',
      h9: '',
      h10: '',
      h11: '',
      enigrs: '',
      eninsk: '',
      region: '',
      district: '',
      town: '',
      cdistrict: '',
      mdistrict: '',
      pgt: '',
      aimak: '',
      ayil: '',
      street: '',
      house: '',
      room: '',
      name: '',
      office: '',
      persons: [],
      form1data: []
    });

  }

  handleChangeForm1(e) {
    const name = e.target.name;
    this.setState({ [name]: e.target.value });
    this.setState({ [name]: e.target.value });
    if (name === 'h6') {
      const perscount = parseInt(e.target.value)
      // const persrow = ['', '', '', '', '', '', '', '', '', '', '', '']
      let persarray = []
      if (perscount <= 100 && perscount !== '') {
        for (let ind = 0; ind < perscount; ind++) {
          persarray.push([ind + 1, '', '', '', '', '', '', '', '', '', '', ''])
        }
        this.setState({ persons: persarray })
      } else {
        this.setState({ persons: [] })
      }
    }
  }

  // async handleSubmitForm1(event) {
  //   event.preventDefault();
  //   const form1data = {
  //     dept_no: this.state.h1,
  //     instructor_sector_no: this.state.h2,
  //     counting_sector_no: this.state.h3,
  //     resident_list_no: this.state.h4,
  //     permanent_resident_household_count: this.state.h5,
  //     total_resident_person_count: this.state.h6,
  //     permanent_resident_person_count: this.state.h7,
  //     temporary_nonresident_person_count: this.state.h8,
  //     temporary_resident_person_count: this.state.h9,
  //     longterm_nonresident_person_count: this.state.h10,
  //     visitor_person_count: this.state.h11,
  //     srs_eni_code: this.state.enigrs,
  //     nsc_eni_code: this.state.eninsk,
  //     region_id: this.state.region,
  //     distinct_id: this.state.district,
  //     city_id: this.state.town,
  //     city_district_id: this.state.cdistrict,
  //     district_name: this.state.mdistrict,
  //     municipality_id: this.state.aimak,
  //     village_id: this.state.ayil,
  //     street_id: this.state.street,
  //     house_no: this.state.house,
  //     flat_no: this.state.room,
  //     surname: this.state.name,
  //     organization_name: this.state.office,
  //   }
  //   await fetch(`http://192.168.2.103:8000/form_1`, {
  //     headers: {
  //       'Accept': 'application/json',
  //       'Content-Type': 'application/json'
  //     },
  //     method: "POST",
  //     body: JSON.stringify(form1data)
  //   })
  //     .then(response => response.json())
  //     .then(data => {
  //       console.log(data)
  //     })
  //     .catch(error => console.error(error))
  //   this.cleardataForm1()
  //   // this.tabtoggle('3')
  // }

  // tabtoggle(tab) {
  //   if (this.state.activeTab !== tab) {
  //     this.setState({
  //       activeTab: tab
  //     });
  //   }
  // }


  render() {

    return (
      <Row>
        <Col sm="12">
          {/* <Form id="f1"> */}
            <Row form>
              <Col md={12}>
                <FormGroup>
                  <Label style={{ fontWeight: 'bold' }}>Переписной лист - Список проживающих</Label>
                </FormGroup>
              </Col>
            </Row>
            <Table size="sm" bordered responsive>
              <thead>
                <tr>
                  <th rowSpan="2">№ переписного отдела</th>
                  <th rowSpan="2">№ инструкторского участка</th>
                  <th rowSpan="2">№ счетного участка</th>
                  <th rowSpan="2">№ списка проживающих</th>
                  <th rowSpan="2">Число постоянно проживающих домохозяйств</th>
                  <th rowSpan="2">Число лиц, записанных в список</th>
                  <th colSpan='4'>в том числе:</th>
                  <th rowSpan="2">Посетитель учреждения коллективного проживания (из гр.12)</th>
                </tr>
                <tr>
                  <th>обычно проживающих (из гр. 4)</th>
                  <th>временно отсутствующих (из гр. 5,6,7)</th>
                  <th>временно проживающих (из гр. 8,9,10)</th>
                  <th>длительно отсутствующих (из гр. 11)</th>
                </tr>
              </thead>
              <tbody>
                <tr>
                  <td><Input onChange={(e) => this.handleChangeForm1(e)} bsSize="sm" type="text" mask="999" maskChar="" tag={InputMask} name="h1" id="h1" /></td>
                  <td><Input onChange={(e) => this.handleChangeForm1(e)} bsSize="sm" type="text" mask="999" maskChar="" tag={InputMask} name="h2" id="h2" /></td>
                  <td><Input onChange={(e) => this.handleChangeForm1(e)} bsSize="sm" type="text" mask="999" maskChar="" tag={InputMask} name="h3" id="h3" /></td>
                  <td><Input onChange={(e) => this.handleChangeForm1(e)} bsSize="sm" type="text" mask="999" maskChar="" tag={InputMask} name="h4" id="h4" /></td>
                  <td><Input onChange={(e) => this.handleChangeForm1(e)} bsSize="sm" type="text" mask="999" maskChar="" tag={InputMask} name="h5" id="h5" /></td>
                  <td><Input onChange={(e) => this.handleChangeForm1(e)} bsSize="sm" type="text" mask="999" maskChar="" tag={InputMask} name="h6" id="h6" /></td>
                  <td><Input onChange={(e) => this.handleChangeForm1(e)} bsSize="sm" type="text" mask="999" maskChar="" tag={InputMask} name="h7" id="h7" /></td>
                  <td><Input onChange={(e) => this.handleChangeForm1(e)} bsSize="sm" type="text" mask="999" maskChar="" tag={InputMask} name="h8" id="h8" /></td>
                  <td><Input onChange={(e) => this.handleChangeForm1(e)} bsSize="sm" type="text" mask="999" maskChar="" tag={InputMask} name="h9" id="h9" /></td>
                  <td><Input onChange={(e) => this.handleChangeForm1(e)} bsSize="sm" type="text" mask="999" maskChar="" tag={InputMask} name="h10" id="h10" /></td>
                  <td><Input onChange={(e) => this.handleChangeForm1(e)} bsSize="sm" type="text" mask="999" maskChar="" tag={InputMask} name="h11" id="h11" /></td>
                </tr>
              </tbody>
            </Table>
            <Table bordered>
              <tbody>
                <tr>
                  <th style={{ width: "50%" }}>
                    Код ЕНИ – ГРС при ПКР
                      </th>
                  <td style={{ width: "50%" }}>
                    <Input onChange={(e) => this.handleChangeForm1(e)} bsSize="sm" type="text" mask="999" maskChar="" tag={InputMask} name="enigrs" />
                  </td>
                </tr>
                <tr>
                  <th style={{ width: "50%" }}>
                    Код ЕНИ – НСК КР
                      </th>
                  <td style={{ width: "50%" }}>
                    <Input onChange={(e) => this.handleChangeForm1(e)} bsSize="sm" type="text" mask="999" maskChar="" tag={InputMask} name="eninsk" />
                  </td>
                </tr>
              </tbody>
            </Table>
            <Row form>
              <Col md={12}>
                <FormGroup>
                  <Label style={{ fontWeight: 'bold' }}>Адрес помещения</Label>
                </FormGroup>
              </Col>
            </Row>
            <Table bordered>
              <tbody>
                <tr>
                  <th style={{ width: "50%" }}>
                    Область
                        <Input onChange={(e) => this.handleChangeForm1(e)} bsSize="sm" type="text" mask="999" maskChar="" tag={InputMask} name="region" />
                  </th>
                  <th style={{ width: "50%" }}>
                    Район
                        <Input onChange={(e) => this.handleChangeForm1(e)} bsSize="sm" type="text" mask="999" maskChar="" tag={InputMask} name="district" />
                  </th>
                </tr>
              </tbody>
            </Table>
            <Table bordered>
              <tbody>
                <tr>
                  <th style={{ width: "40%" }}>
                    Город
                        <Input onChange={(e) => this.handleChangeForm1(e)} bsSize="sm" type="text" mask="999" maskChar="" tag={InputMask} name="town" />
                  </th>
                  <th style={{ width: "30%" }}>
                    Внутригородской район
                        <Input onChange={(e) => this.handleChangeForm1(e)} bsSize="sm" type="text" mask="999" maskChar="" tag={InputMask} name="cdistrict" />
                  </th>
                  <th style={{ width: "30%" }}>
                    Поселок городского типа
                        <Input onChange={(e) => this.handleChangeForm1(e)} bsSize="sm" type="text" mask="999" maskChar="" tag={InputMask} name="pgt" />
                  </th>
                </tr>
              </tbody>
            </Table>
            <Table bordered>
              <tbody>
                <tr>
                  <th style={{ width: "50%" }}>
                    Наименование или номер городского микрорайона, жилмассива, новостройки
                        <Input onChange={(e) => this.handleChangeForm1(e)} bsSize="sm" type="text" mask="999" maskChar="" tag={InputMask} name="mdistrict" />
                  </th>
                  <th style={{ width: "50%" }}>
                    Айылный аймак
                        <Input onChange={(e) => this.handleChangeForm1(e)} bsSize="sm" type="text" mask="999" maskChar="" tag={InputMask} name="aimak" />
                  </th>
                </tr>
              </tbody>
            </Table>
            <Table bordered>
              <tbody>
                <tr>
                  <th style={{ width: "40%" }}>
                    Село (айыл)
                        <Input onChange={(e) => this.handleChangeForm1(e)} bsSize="sm" type="text" mask="999" maskChar="" tag={InputMask} name="ayil" />
                  </th>
                  <th style={{ width: "40%" }}>
                    Проспект, улица, переулок
                        <Input onChange={(e) => this.handleChangeForm1(e)} bsSize="sm" type="text" mask="999" maskChar="" tag={InputMask} name="street" />
                  </th>
                  <th style={{ width: "10%" }}>
                    № дома
                        <Input onChange={(e) => this.handleChangeForm1(e)} bsSize="sm" type="text" mask="999" maskChar="" tag={InputMask} name="house" />
                  </th>
                  <th style={{ width: "10%" }}>
                    № квартиры
                        <Input onChange={(e) => this.handleChangeForm1(e)} bsSize="sm" type="text" mask="999" maskChar="" tag={InputMask} name="room" />
                  </th>
                </tr>
              </tbody>
            </Table>
            <Table bordered>
              <tbody>
                <tr>
                  <th style={{ width: "50%" }}>
                    Фамилия, имя, отчество
                        <Input onChange={(e) => this.handleChangeForm1(e)} bsSize="sm" type="text" mask="999" maskChar="" tag={InputMask} name="name" />
                  </th>
                  <th style={{ width: "50%" }}>
                    Учреждение
                        <Input onChange={(e) => this.handleChangeForm1(e)} bsSize="sm" type="text" mask="999" maskChar="" tag={InputMask} name="office" />
                  </th>
                </tr>
              </tbody>
            </Table>
            <Row form>
              <Col md={12}>
                <FormGroup>
                  <Label style={{ fontWeight: 'bold' }}>Список проживающих (число жильцов) в помещении</Label>
                </FormGroup>
              </Col>
            </Row>
            <Table size="sm" bordered responsive>
              <thead>
                <tr>
                  <th rowSpan="2">№ п.п. лица в пределах помещения</th>
                  <th rowSpan="2">№ п.п. домохозяйства в пределах помещения</th>
                  <th rowSpan="2">№ п.п. лица в пределах домохозяйства</th>
                  <th rowSpan="2">Фамилия, имя, отчество (полностью)</th>
                  <th colSpan='3'>Для постоянно (обычно) здесь проживающего, но временно отсутствующего, записать:</th>
                  <th colSpan='3'>Для временно пребывающего (проживающего) записать:</th>
                  <th rowSpan="2">Есть ли члены домохозяйства, длительно (1 год и более) проживающие за границей Кыргызстана? (заполняется только бланк по ф.4) 1- да 2- нет </th>
                  <th rowSpan="2">Посетитель в учреждении коллективного проживания (заполняется   бланк по ф.5)</th>
                </tr>
                <tr>
                  <th>а) адрес места временного проживания (название района, города Кыргызстана/ другой страны)</th>
                  <th>б) продолжительность отсутствия: 1- менее 1-го месяца; 2- до 1-го года</th>
                  <th>в) причина отсутствия: 1- работа; 2- учеба; 3- семей-ные обстояте-льства; 4- иное</th>
                  <th>а) место обычного проживания (название района, города Кыргызстана/другой страны)</th>
                  <th>б) продолжительность отсутствия в месте постоянного жительства: 1- менее 1-го месяца; 2- до 1-го года</th>
                  <th>в) причина пребывания: 1- работа; 2- учеба; 3- семейные обстоятельст-ва; 4- иное</th>
                </tr>
                <tr>
                  <th>1</th>
                  <th>2</th>
                  <th>3</th>
                  <th>4</th>
                  <th>5</th>
                  <th>6</th>
                  <th>7</th>
                  <th>8</th>
                  <th>9</th>
                  <th>10</th>
                  <th>11</th>
                  <th>12</th>
                </tr>
              </thead>
              <tbody>
                {this.state.persons.map((person, index) =>
                  <tr key={index}>
                    {person.map((prow, rindex) =>
                      <td key={`i_${index}_${rindex}`}><Input onChange={(e) => this.handleChangeForm1(e)} value={prow} bsSize="sm" type="text" name={`t_${index}_${rindex}`} id={`t_${index}_${rindex}`} /></td>
                    )}
                  </tr>)}
              </tbody>
            </Table>
            {/* <Row form>
              <Col md={12}>
                <FormGroup>
                  <Button onClick={this.handleClearForm1} color="danger" size="sm">Очистить</Button>{' '}
                </FormGroup>
              </Col>
            </Row> */}
          {/* </Form> */}
        </Col>
      </Row>
    )
  }
}

export default Form1;
